#include <stdio.h>
#define N 7
int fun(int *a,int *x)
 { int i<N,j=0; 
for(i=0;i<N;i++)
 if( *（a+i）<60)
{ *(x+j)=*(a+i); j++;} 
return j;}
main( ){ 
int a[N]={22,99,44,66,55,88,33},x[N],i,k;
 k=fun(a,x）；
 for（i=0;i<k;i++） printf(“%d”,x[i]); printf(“\n”);}

int x =1, y=1 ;
int m=1,n=1;
switch (m)
{ 
  case 0 : x=x*2;
  case 1: {
           switch (n){ 
                       case 1 : x=x*2;
                       case 2 : y=y*2;break;
                       case 3 : x++;}
                       }
  case 2 : x++;y++;
  case 3 : x*=2;y*=2;break;
default:x++;y++;
}

